INSERT INTO `film` (`show_id`, `title`, `date_added`, `release_year`, `rating`, `duration`, `description`) VALUES
(247747, 'Amar Akbar Anthony', 'December 31, 2019', 1977, 'TV-14', '172 min', 'Abandoned in a park by their father, Amar, Akbar and Anthony grow up independently and have no knowledge of one another. They\'re reunited as adults when, by coincidence, they all give blood at the same hospital.'),
(269880, 'Bad Boys', 'October 1, 2019', 1995, 'R', '119 min', 'In this fast-paced actioner, two Miami narcotics cops are hot on the trail of a master crook who has snatched $100 million worth of heroin.'),
(281550, 'La Bamba', 'January 1, 2020', 1987, 'PG-13', '109 min', 'The plane crash that killed Buddy Holly also took Ritchie Valens, whose modest upbringing and rise to fame are depicted in this exhilarating biopic.'),
(284890, 'Barsaat', 'April 1, 2018', 1995, 'TV-PG', '166 min', 'A naïve young man and a rich city girl fall in love. Her stepfather, however, doesn\'t approve of the match and will stop at nothing to split the pair.'),
(292118, 'Beavis and Butt-head Do America', 'November 20, 2019', 1996, 'PG-13', '81 min', 'After realizing that their boob tube is gone, Beavis and Butt-head set off on an expedition that takes them from Las Vegas to the nation\'s capital.'),
(296682, 'Benji', 'March 6, 2018', 1974, 'G', '86 min', 'After lovable abandoned mutt Benji is adopted by a kind family, he chases cats, flirts with a show dog and bravely helps to rescue two abducted kids.'),
(347365, 'Candyman', 'October 1, 2019', 1992, 'R', '99 min', 'Grad student Helen Lyle unintentionally summons the Candyman, a hook-handed creature made flesh by other people\'s belief in him.'),
(352989, 'Carrie', 'June 1, 2019', 1976, 'R', '98 min', 'An outcast teen with telekinetic ability lashes out with her deadly power when the high school \"in crowd\" torments her with a sick joke at the prom.'),
(372195, 'Child\'s Play', 'December 31, 2019', 1988, 'R', '87 min', 'When a rash of murders unfolds, 6-year-old Andy knows that his toy doll Chucky is the killer, but neither his mom nor the cops believe him.'),
(374651, 'Chitty Chitty Bang Bang', 'January 1, 2020', 1968, 'G', '146 min', 'Quirky inventor Caractacus Potts and his family travel in their magical flying car to Vulgaria, a kingdom strangely devoid of children.'),
(382650, 'Cleopatra Jones', 'November 1, 2019', 1973, 'PG', '89 min', 'A stylin\' special agent chases down drug lords and does her part to stop trafficking. Soon, she finds herself seeking revenge on a dealer.'),
(404067, 'The Craft', 'January 1, 2020', 1996, 'R', '101 min', 'At a Catholic school, a new girl falls in with a clique of teen witches who wield their powers against anyone who crosses them, even their parents.'),
(408911, 'The Crow', 'January 1, 2019', 1994, 'R', '102 min', 'One year after Eric Draven and his fiancée are murdered, Draven – watched over by a hypnotic crow – returns from the grave to exact revenge.'),
(419733, 'The Dark Crystal', 'May 1, 2019', 1982, 'PG', '93 min', 'In this mythical tale, Jen, the last of the Gelfling race, is charged with healing the Crystal of Truth after its mutilation sets off an era of terror.'),
(449931, 'Doctor Zhivago', 'November 1, 2019', 1965, 'PG-13', '200 min', 'A young physician and his beautiful mistress get swept up in the danger and drama of the Bolshevik Revolution in this Oscar-winning epic.'),
(484369, 'The Evil Dead', 'January 10, 2020', 1981, 'TV-MA', '85 min', 'During a stop at a remote cabin deep within the woods, a group of teens begins turning into flesh-eating zombies in director Sam Raimi\'s cult classic.'),
(485218, 'Executive Decision', 'November 1, 2019', 1996, 'R', '133 min', 'When terrorists hijack a 747 and turn it into a nerve gas bomb aimed at Washington, D.C., commandos use an experimental plane to try to stop them.'),
(498716, 'Ferris Bueller\'s Day Off', 'January 3, 2020', 1986, 'PG-13', '103 min', 'Ferris convinces his entire school he\'s at death\'s door, then hits the streets of Chicago with his girlfriend and best friend for a day of fun.'),
(506464, 'The First Wives Club', 'November 20, 2019', 1996, 'PG', '103 min', 'Following a friend\'s suicide after her husband dumps her for a younger model, three women plot payback against their two-timing exes.'),
(510854, 'The Flintstones', 'October 1, 2019', 1994, 'PG', '91 min', 'The Flintstones hit the big screen in this live-action comedy that finds Fred and Barney struggling to cope with the pressures of work and family.'),
(516154, 'For the Love of Benji', 'March 6, 2018', 1977, 'G', '84 min', 'Benji and his owner get separated in Greece. On his quest to find them, he\'s targeted by various bad guys who want to get their hands on him.'),
(516788, 'Forbidden Planet', 'November 1, 2019', 1956, 'G', '98 min', 'A pulp-fiction sci-fi classic, Forbidden Planet stars Leslie Nielsen as a heroic starship captain who finds the paradise planet Altair-IV.'),
(520489, 'Four Weddings and a Funeral', 'August 1, 2019', 1994, 'R', '118 min', 'A commitment-phobic Brit tries to reconnect with an alluring American who\'s about to make a seemingly awful mistake by marrying a wealthy, boring man.'),
(523650, 'Free Willy', 'January 1, 2020', 1993, 'PG', '112 min', 'Ordered to clean up the graffiti he painted at a marine theme park, a troubled young boy unexpectedly bonds with a killer whale on exhibit.'),
(542137, 'Gigi', 'November 1, 2019', 1958, 'G', '115 min', 'Gigi\'s an avant-garde French waif being groomed as the fille de joie of affluent and handsome Gaston. Soon Gigi metamorphoses into a stunning beauty.'),
(569355, 'Hamburger Hill', 'November 23, 2019', 1987, 'R', '110 min', 'The Vietnam War\'s horrors come brutally to life through the eyes of American soldiers trying to take a heavily fortified hill under Vietcong control.'),
(607931, 'How to Make an American Quilt', 'April 1, 2018', 1995, 'PG-13', '116 min', 'A conflicted young woman spends the summer with her grandmother, her great-aunt and their quilting circle, whose life stories captivate her.'),
(653673, 'Jimi Hendrix', 'November 1, 2019', 1973, 'R', '102 min', 'Jimi Hendrix\'s family, friends, and fellow musicians discuss his life and influence. Hendrix also appears in classic performance footage.'),
(673843, 'Kingpin', 'January 1, 2020', 1996, 'PG-13', '114 min', 'After a bowler loses his hand, his career takes a nosedive. That is, until he uncovers the next big thing: an Amish kid named Ishmael.'),
(684847, 'The Last Boy Scout', 'November 1, 2019', 1991, 'R', '105 min', 'Private eye Joe Hallenbeck is forced to team up with a disgraced quarterback to uncover a conspiracy by a politician and a football team owner.'),
(699257, 'Monty Python\'s Life of Brian', 'October 2, 2018', 1979, 'R', '94 min', 'Born in a stable in Judea, Brian grows up to join a group of anti-Roman zealots, but his fate keeps getting confused with that of a certain carpenter.'),
(701346, 'Like Water for Chocolate', 'November 1, 2019', 1992, 'R', '105 min', 'When Pedro marries her sister, Tita throws herself into her cooking – and discovers she can transfer her emotions through the food she prepares.'),
(709163, 'Logan\'s Run', 'November 1, 2019', 1976, 'PG', '118 min', 'In the 23rd century, inhabitants of a domed city exist in a world filled with life\'s pleasures – but no one is allowed to live past the age of 30.'),
(709380, 'Lolita', 'November 1, 2019', 1962, 'R', '153 min', 'In this black comedy, an English professor marries his landlady to get closer to his forbidden obsession: her teenage daughter.'),
(771476, 'Monty Python and the Holy Grail', 'January 2, 2019', 1975, 'PG', '92 min', 'The Monty Python comedy clan skewers King Arthur and his Knights of the Round Table as they quest far and wide for the Holy Grail.'),
(786137, 'My Girl', 'January 1, 2020', 1991, 'PG-13', '102 min', 'This coming-of-age charmer follows a summer in the life of an 11-year-old girl who learns about love and loss as she grapples with profound changes.'),
(793907, 'The Natural', 'January 1, 2020', 1984, 'PG', '138 min', 'A gifted baseball player whose life has taken some startling turns becomes a 35-year-old rookie who helps a cellar-dwelling team get back in the game.'),
(846071, 'Patriot Games', 'January 1, 2020', 1992, 'R', '117 min', 'CIA desk jockey Jack Ryan plunges into the heart of international terrorism after spoiling an assassination attempt on a British royal family member.'),
(848915, 'The Pelican Brief', 'November 1, 2019', 1993, 'PG-13', '141 min', 'When law student Darby Shaw theorizes about the assassinations of two Supreme Court justices, she is put in danger and turns to a reporter for help.'),
(855084, 'Philadelphia', 'July 1, 2019', 1993, 'PG-13', '126 min', 'Philadelphia attorney Andrew Beckett launches a wrongful termination suit against his law firm when they fire him because he\'s gay and HIV-positive.'),
(873159, 'Primal Fear', 'December 1, 2019', 1996, 'R', '131 min', 'When a blood-spattered altar boy is found running from a murder scene, his conviction seems certain – but his attorney is determined to win the case.'),
(880640, 'Pulp Fiction', 'January 1, 2019', 1994, 'R', '154 min', 'This stylized crime caper weaves together stories featuring a burger-loving hit man, his philosophical partner and a washed-up boxer.'),
(896678, 'Red Dawn', 'December 31, 2019', 1984, 'PG-13', '114 min', 'A group of teenagers witnesses Soviet and Cuban paratroopers descending on their small Colorado town and systematically setting off World War III.'),
(907090, 'Richard Pryor: Live in Concert', 'December 1, 2016', 1979, 'TV-MA', '79 min', 'Richard Pryor\'s classic 1979 concert film has him discussing a wide range of topics, including race, the police and his favorite target – himself.'),
(915927, 'Rocky', 'August 1, 2019', 1976, 'PG', '120 min', 'Sylvester Stallone shot to fame as Rocky Balboa, an unknown fighter who\'s given a shot at fighting world champ Apollo Creed as a publicity stunt.'),
(916043, 'Rocky II', 'August 1, 2019', 1979, 'PG', '119 min', 'Featuring a rousing climax, this engaging sequel finds boxer Rocky Balboa returning to the ring for a rematch against reigning champ Apollo Creed.'),
(916061, 'Rocky IV', 'August 1, 2019', 1985, 'PG', '92 min', 'Rocky Balboa takes on the Cold War, coming out of retirement to battle a Soviet fighter who pulverized Rocky\'s friend and former rival, Apollo Creed.'),
(923574, 'Rumble in the Bronx', 'November 1, 2019', 1995, 'R', '89 min', 'During a visit to the Bronx to help out at his uncle\'s store, a cheerful martial arts expert springs into action when a gang terrorizes the shop.'),
(973861, 'Sling Blade', 'November 1, 2019', 1996, 'R', '135 min', 'A man returns home after being released from a psychiatric hospital, where he\'d been confined since age 12 for murdering his mother and her lover.'),
(1005494, 'The Stranger', 'July 19, 2018', 1946, 'TV-PG', '94 min', 'A Nazi fugitive hiding in Connecticut tries to keep his identity hidden from his naïve new wife while a dogged investigator pursues him relentlessly.'),
(1008581, 'Stripes', 'September 1, 2019', 1981, 'R', '106 min', 'After losing everything, an indolent sad sack impulsively joins the U.S. Army and cajoles his best friend into enlisting, too.'),
(1065372, 'The Trigger Effect', 'January 1, 2018', 1996, 'R', '94 min', 'When a power failure throws their suburban town into chaos, Matthew and his wife stoop to desperate measures to secure medication for their child.'),
(1067876, 'True Grit', 'January 1, 2020', 1969, 'G', '128 min', 'Teenage tomboy Mattie Ross enlists the help of crusty lawman Rooster Cogburn to track down the hired hand who murdered her father.'),
(1145882, 'Young Tiger', 'November 1, 2016', 1973, 'NR', '81 min', 'Aided only by a tough female police officer, a Hong Kong taxi driver tries to escape from gangsters pursuing incriminating evidence left in his cab.'),
(1150871, 'Love Jones', 'November 1, 2019', 1997, 'R', '109 min', 'In this urban romantic comedy set in Chicago, the ups and downs of courtship play out between a young black poet and a pretty shutterbug.'),
(1151188, 'Chasing Amy', 'January 1, 2020', 1997, 'R', '113 min', 'Comic book artist Holden meets the perfect woman, only to learn that she\'s a lesbian. But that doesn\'t stop him from falling in love with her.'),
(1151375, 'Dante\'s Peak', 'September 1, 2019', 1997, 'PG-13', '108 min', 'When a volcanologist comes to investigate the recent rumblings of a dormant volcano, a massive eruption has everyone in town fighting for their lives.'),
(1151721, 'Donnie Brasco', 'January 1, 2020', 1997, 'R', '127 min', 'When FBI agent Joe Pistone goes undercover to infiltrate the mob, he starts to identify with the made men he\'s charged with taking down.'),
(1153194, 'The Saint', 'September 1, 2019', 1997, 'PG-13', '116 min', 'Hired by a Russian politician to steal the formula for cold fusion, master thief Simon Templar falls for the scientist who has unlocked the secret.'),
(1153656, 'Austin Powers: International Man of Mystery', 'December 1, 2019', 1997, 'PG-13', '90 min', 'A swingin\' fashion photographer by day and a groovy British secret agent by night, superspy Austin Powers must foil the sinister schemes of Dr. Evil.'),
(1171655, 'Bean: The Ultimate Disaster Movie', 'August 1, 2018', 1997, 'PG-13', '89 min', 'Disaster-prone Mr. Bean is sent to Los Angeles to guard a famous painting, but as he\'s unfit for any physical task, everything goes hilariously wrong.'),
(1178866, 'The Game', 'November 1, 2019', 1997, 'R', '129 min', 'Nicholas receives an unusual birthday present from his brother, Conrad – a gift certificate to play a unique kind of game formulated by \"CRS.\"'),
(1179333, 'How to Be a Player', 'November 1, 2019', 1997, 'R', '94 min', 'Dray lives life one woman at a time and is the envy of all his friends, until his sister decides to show him the error of his philandering ways.'),
(1179574, 'Event Horizon', 'January 1, 2020', 1997, 'R', '96 min', 'After a signal is received from a long-missing spaceship, a rescue ship investigates, but the crew soon realizes something unimaginable has happened.'),
(1179583, 'Money Talks', 'November 1, 2019', 1997, 'R', '96 min', 'TV news reporter James Russell helps put small-time criminal Franklin Hatchett in jail, but turns to protecting Hatchett when he escapes from prison.'),
(1180086, 'Kiss the Girls', 'January 1, 2020', 1997, 'R', '116 min', 'A forensic psychologist teams up with an escaped kidnapping victim to hunt down a serial killer who abducts and dominates strong-willed women.'),
(1181488, 'As Good as It Gets', 'January 1, 2020', 1997, 'PG-13', '139 min', 'The structured world of a sour, obsessive-compulsive author crumbles when he\'s drawn into the lives of a stressed-out single mom and his gay neighbor.'),
(1181550, 'Scream 2', 'October 1, 2019', 1997, 'R', '121 min', 'Gale has written a best-seller which has been turned into a film. As the movie premiere looms closer, the mysterious deaths begin again.'),
(1181661, 'The Rainmaker', 'November 20, 2019', 1997, 'PG-13', '136 min', 'A young attorney and a scrappy paralegal work to help the parents of a terminally ill boy in their suit against an insurance company.'),
(1192866, 'Fallen', 'November 1, 2019', 1998, 'R', '124 min', 'A tough homicide cop faces his most dangerous assignment when he must stop a murderous evil spirit who can move from one host to the next.'),
(1193180, 'Kurt & Courtney', 'January 8, 2019', 1998, 'R', '95 min', 'This film charts Nirvana\'s Kurt Cobain\'s rise to fame, his drug-addled romance with Courtney Love and the conspiracy theories surrounding his death.'),
(5670479, 'The Mask of Zorro', 'January 1, 2020', 1998, 'PG-13', '138 min', 'An aging Zorro passes the torch to a young successor, schooling him in discipline and training him to take up the sword against crooked officials.'),
(11546798, 'Lifeline', 'August 16, 2018', 1997, 'TV-14', '104 min', 'Johnnie To\'s character-centered drama follows a Hong Kong firefighting crew as they take on harrowing rescue missions and navigate personal dilemmas.'),
(11819434, 'Fear and Loathing in Las Vegas', 'November 1, 2019', 1998, 'R', '118 min', 'A sportswriter and his Samoan lawyer embark on a hallucinogenic three-day romp from Los Angeles to Las Vegas in this counterculture cult favorite.'),
(11819467, 'Godzilla', 'January 1, 2020', 1998, 'PG-13', '139 min', 'A team of experts – including a biologist and two scientists – must stop an oversized lizard from destroying all of Manhattan.'),
(15815343, 'The Texas Chainsaw Massacre', 'October 22, 2019', 1974, 'R', '83 min', 'When some friends visit a vandalized graveyard, they come upon a chainsaw-wielding maniac, and it\'s a fight to the bloody death between good and evil.'),
(16914787, 'BASEketball', 'November 1, 2018', 1998, 'R', '103 min', 'When two slackers\' made-up sport, BASEketball, becomes a national craze, they hope to cash in on the basketball/baseball hybrid\'s popularity.'),
(16944044, 'Lock, Stock and Two Smoking Barrels', 'January 1, 2019', 1998, 'R', '108 min', 'Hoping to make a bundle in a high-stakes poker game, four shiftless lads from London\'s East End instead find themselves swimming in debt.'),
(17016471, 'Tomorrow Never Dies', 'December 31, 2019', 1997, 'PG-13', '119 min', 'Pierce Brosnan stars in this 007 installment, which teams the secret agent and a sexy Chinese superspy against a megalomaniacal media mogul.'),
(17236920, 'Rounders', 'November 1, 2019', 1998, 'R', '121 min', 'A law student befriends and \"befoes\" a fellow gambling addict and a club owner, and tensions run high when they must come up with $15k in just 5 days.'),
(17457622, 'Judwaa', 'December 31, 2019', 1997, 'TV-14', '133 min', 'Separated at birth, a pair of identical twins unexpectedly reunite as adults and embark on a madcap mission to take down a common enemy from their past.'),
(17457962, 'Raja Hindustani', 'May 1, 2017', 1996, 'TV-14', '177 min', 'When a poor taxi driver falls in love with a wealthy young woman, he must stand up to her family and contend with his own insecurities.'),
(17671454, 'Dil Se', 'March 1, 2018', 1998, 'TV-14', '166 min', 'A radio broadcaster\'s intense attraction to a mysterious woman opens the door to a tidal wave of powerful emotions and desires.'),
(17672040, 'The River Wild', 'September 1, 2018', 1994, 'PG-13', '111 min', 'A turbulent vacation turns deadly when a fugitive and his crew kidnap a river rafting guide and her family, forcing them down the dangerous river.'),
(17687959, 'The Waterboy', 'March 8, 2017', 1998, 'PG-13', '90 min', 'A water boy for a college football team has a rage that makes him a tackling machine whose bone-crushing power might vault his team into the playoffs.'),
(17969262, 'Khalnayak', 'March 1, 2018', 1993, 'TV-14', '170 min', 'A prison guard goes undercover as a dancer to try and recapture an escaped criminal and restore her police inspector boyfriend\'s reputation.'),
