(81172911, 'Being Mrs Elliot', 'December 20, 2019', 2014, 'TV-14', '113 min', 'When a scorned wife from the city shares a cab with a troubled villager, a fiery accident forces them to live out each other\'s lives.'),
(81173255, 'The Heretics', 'September 4, 2019', 2017, 'TV-MA', '88 min', 'A withdrawn young woman hunted by a malicious cult is abducted by a brooding stranger and undergoes a bizarre transformation.'),
(81173792, 'Betty White: First Lady of Television', 'January 12, 2020', 2018, 'TV-14', '56 min', 'This documentary on actress and television producer Betty White traces her decades-long career as a  woman breaking new ground in entertainment.'),
(81176200, 'Manmadhudu 2', 'September 23, 2019', 2019, 'TV-MA', '152 min', 'Under pressure to marry, a perennial bachelor hires a much younger woman to act as his fiancée, but her bond with his family throws his plan for a loop.'),
(81177238, 'Malaal', 'September 26, 2019', 2019, 'TV-14', '133 min', 'Class divides become thorns in the budding romance between the crony of a nativist Mumbai politician and the new, North Indian resident of his chawl.'),
(81177367, 'Noblemen', 'October 5, 2019', 2019, 'TV-MA', '109 min', 'When he lands the lead in his Christian school\'s production of \"The Merchant of Venice,\" a secretly gay student is bullied by wealthy upperclassmen.'),
(81177371, 'Mehandi Circus', 'October 30, 2019', 2019, 'TV-14', '126 min', 'In the early 1990s, the love between a cassette shop owner and a traveling circus performer challenges caste barriers and disapproving parents.'),
(81177504, 'The Body Remembers When the World Broke Open', 'November 27, 2019', 2019, 'TV-MA', '106 min', 'After a traumatic event, two Indigenous women in Vancouver are brought together and form a deep bond despite leading different lives.'),
(81179693, 'Euphoria', 'November 1, 2019', 2018, 'R', '110 min', 'An entrepreneur prone to partying and his estranged brother, a teacher resigned to a humdrum life, begin to bond under fragile circumstances.'),
(81183491, 'Jamtara - Sabka Number Ayega', 'January 10, 2020', 2020, 'TV-MA', '1 Season', 'A group of small-town young men run a lucrative phishing operation, until a corrupt politician wants in on their scheme – and a cop wants to fight it.'),
(81183570, 'Home Is Where the Killer Is', 'October 9, 2019', 2019, 'TV-14', '87 min', 'Recovering from cancer, a young woman thinks she’s found a friend when she rents a room from a caring ex-doctor. But empathy soon becomes obsession.'),
(81183572, 'Deviant Love', 'September 13, 2019', 2019, 'TV-14', '87 min', 'In a tailspin after her marriage collapses, Jamie falls for a helpful gentleman whose interest in her welfare hides sinister motives.'),
(81186757, 'Oh! Baby (Tamil)', 'September 25, 2019', 2019, 'TV-14', '146 min', 'A surly septuagenarian gets another chance at her 20s after having her photo snapped at a studio that magically takes 50 years off her life.'),
(81186758, 'Oh! Baby (Malayalam)', 'September 25, 2019', 2019, 'TV-14', '146 min', 'A surly septuagenarian gets another chance at her 20s after having her photo snapped at a studio that magically takes 50 years off her life.'),
(81188871, 'Let\'s Dance', 'December 4, 2019', 2019, 'TV-MA', '109 min', 'After his crew breaks up, a gifted but insecure hip-hop dancer teaches at a top ballet school in Paris, where he falls for an aspiring ballerina.'),
(81189396, 'Spitfire: The Plane that Saved the World', 'November 1, 2019', 2018, 'TV-14', '95 min', 'In this epic documentary, last-surviving veterans trace the history of a legendary fighter aircraft that dominated the air during the Battle of Britain.'),
(81189912, 'Drive', 'November 1, 2019', 2019, 'TV-14', '119 min', 'A notorious thief allies with a street racer for a grand heist involving an elaborate game of deceit with authorities, who have their own dirty secrets.'),
(81191666, 'The Bling Lagosians', 'October 11, 2019', 2019, 'TV-14', '99 min', 'With a matriarch bent on having a lavish 51st birthday party, her family\'s debt is on the verge of exposure, threatening their business – and legacy.'),
(81194544, 'Evvarikee Cheppoddu', 'November 27, 2019', 2019, 'TV-14', '134 min', 'When caste differences throw a wrench into their otherwise blossoming relationship, a couple must somehow convince the girl’s father to let them marry.'),
(81196441, 'El sendero de la anaconda', 'November 15, 2019', 2019, 'TV-PG', '74 min', 'In the most remote areas of the Amazon jungle, a writer and his anthropologist friend meet communities who have resisted change for centuries.'),
(81206389, 'Oththa Seruppu Size 7', 'November 4, 2019', 2019, 'TV-MA', '103 min', 'Taken into custody, a murder suspect\'s theatrical explanations of his peculiar modus operandi unearth truths far beyond the crime he’s accused of.'),
(81210770, 'The 9th Precinct', 'December 13, 2019', 2019, 'TV-14', '95 min', 'An idealistic cop joins an underground police unit and battles ghoulish forces threatening the balance between the human and the supernatural realms.'),
(81213148, 'Isoken', 'December 15, 2019', 2017, 'TV-14', '98 min', 'Single at 34, Isoken is maneuvered by her mother toward a relationship with a black entrepreneur but finds herself drawn to a white photojournalist.'),
(81213149, 'Potato Potahto', 'December 15, 2019', 2017, 'TV-MA', '104 min', 'A divorced couple decides to continue sharing a home but their already-delicate cohabiting scheme unravels when they begin dating other people.'),
(81213153, 'Hope: One in a Billion', 'December 15, 2019', 2017, 'TV-14', '81 min', 'The remarkable true story of Gift Ngoepe, the first African to play for Major League Baseball, is recounted in this inspiring documentary.'),
(81213873, 'Veerey Ki Wedding', 'December 31, 2019', 2018, 'TV-14', '130 min', 'Quick to throw punches in the name of justice, a young man must find a calmer way to win over the pacifist father of the girl he wishes to marry.'),
(81213874, 'Vodka Diaries', 'December 31, 2019', 2018, 'TV-14', '113 min', 'While investigating a series of murders and the nightclub that links them, a detective’s case takes an alarming turn when his wife goes missing.'),
(81213876, 'Adrishya', 'December 31, 2019', 2017, 'TV-14', '99 min', 'A family’s harmonious existence is interrupted when the young son begins showing symptoms of anxiety that seem linked to disturbing events at home.'),
(81213879, 'The Dark Side of Life: Mumbai City', 'December 31, 2019', 2018, 'TV-MA', '121 min', 'Struggling with Mumbai\'s pressures and private battles with depression, six lives intersect just as they reach a breaking point.'),
(81213882, 'Phullu', 'December 31, 2019', 2017, 'TV-14', '96 min', 'Struck by the lack of clean resources for menstruating women in his village, a jobless loafer braves social stigmas to create low-cost sanitary napkins.'),
(81213884, 'Zed Plus', 'December 31, 2019', 2014, 'TV-MA', '131 min', 'A philandering small-town mechanic\'s political ambitions are sparked when the visiting prime minister mistakenly grants him special security clearance.'),
(81213885, 'Jaan-E-Mann: Let\'s Fall in Love... Again', 'December 31, 2019', 2006, 'TV-14', '163 min', 'To avoid alimony payments, an aspiring actor schemes for his ex-wife to marry an unlikely suitor, but soon realizes he may not be ready to lose her.'),
(81213887, 'Ramji Londonwaley', 'December 31, 2019', 2005, 'TV-14', '154 min', 'A small-town cook moves to London to earn a living, but from his employer’s sudden death to the immigration officials on his trail, plans soon go sour.'),
(81213888, 'Dhamaal', 'December 31, 2019', 2007, 'TV-14', '128 min', 'Tipped off about buried money in Goa, four ne’er-do-well friends go on the hunt, chased by a police officer who wants the treasure for himself.'),
(81213889, 'Bhoot', 'December 31, 2019', 2003, 'TV-MA', '114 min', 'After a couple moves into an apartment, the wife’s increasingly disturbing behavior unravels chilling secrets about their new home’s past.'),
(81213891, 'Deewangee', 'January 3, 2020', 2002, 'TV-MA', '156 min', 'Hired by a singer to defend her friend, who has been accused of murder, a formidable lawyer learns that the man he represents may not be innocent.'),
(81213893, 'Chal Mere Bhai', 'December 31, 2019', 2000, 'TV-14', '132 min', 'When a secretary saves her tycoon boss\'s life, his family hears wedding bells. Problem is, she\'s already in love – with his younger brother.'),
(81213894, 'The Zoya Factor', 'November 30, 2019', 2019, 'TV-14', '135 min', 'A goofy copywriter unwittingly convinces the Indian cricket team that she’s their lucky mascot, to the dismay of their superstition-shunning captain.'),
(81213895, 'Khubsoorat', 'December 31, 2019', 1980, 'TV-PG', '120 min', 'A strict matriarch\'s regimented household is upended by the arrival of a spunky relative who challenges the rules.'),
(81213896, 'Rajnigandha', 'December 31, 2019', 1974, 'TV-PG', '104 min', 'A grad student leaves her boyfriend in Delhi for a job interview in Mumbai, where she reconnects with an old flame for whom she still has feelings.'),
(81213897, 'Namak Halaal', 'December 31, 2019', 1982, 'TV-14', '171 min', 'While loyally defending his boss from mobsters trying to kill him, a naive, hotel bellboy discovers the family he never knew he had.'),
(81213898, 'The Great Gambler', 'December 31, 2019', 1979, 'TV-14', '161 min', 'After unwittingly using his skills to obtain military secrets, a gambler is pursued by a police officer who happens to be his doppelgänger.'),
(81213979, 'Masoom', 'December 31, 2019', 1983, 'TV-14', '138 min', 'A loving husband and father\'s joyful family life is rocked to its core upon the discovery that he has a young son borne from a past extramarital affair.'),
(81214114, 'Bulletproof 2', 'January 9, 2020', 2020, 'TV-MA', '97 min', 'A special agent abruptly reunites with a criminal – once a former friend – when he attempts to use his identity to infiltrate and take down a cartel.'),
(81214187, 'Jinxed', 'November 2, 2019', 2013, 'TV-G', '69 min', 'After a century-old curse of bad luck, a determined teen embarks on a journey to break her family’s generational misfortune.'),
(81214214, 'The Massively Mixed-Up Middle School Mystery', 'November 2, 2019', 2015, 'TV-G', '40 min', 'After the school principal gets pranked, a curious crew of preteen super sleuths tests their detective skills to solve an underwater ruse.'),
(81214223, 'A Fairly Odd Summer', 'November 2, 2019', 2014, 'TV-G', '68 min', 'In this live-action adventure, the gang heads to Hawaii, where Timmy learns the source of all fairy magic is in dangerous hands.'),
(81215437, 'Escape from Mr. Lemoncello’s Library', 'November 2, 2019', 2017, 'TV-G', '69 min', 'An eccentric game designer builds a library full of traps and tricks for a group of kids who score the chance to navigate his elaborate scavenger hunt.'),
(81215438, 'Hey Arnold! The Jungle Movie', 'November 2, 2019', 2017, 'TV-PG', '81 min', 'When Arnold and his crew win a trip to San Lorenzo, their adventure in the wild forces them to take the same risky path as Arnold\'s missing parents.'),
(81215439, 'Liar, Liar, Vampire', 'November 2, 2019', 2015, 'TV-PG', '68 min', 'When a shy teen transfers to a new school, he elects to mix things up by playing along with the rumor that he\'s a vampire.'),
(81215481, 'Pranaam', 'November 25, 2019', 2019, 'TV-MA', '117 min', 'Aspiring to fulfill his father’s dream and become a civil services officer, a young man loses his way upon becoming entangled with a criminal lynchpin.'),
(81217436, 'Road to Sangam', 'December 31, 2019', 2010, 'TV-14', '136 min', 'As communal violence erupts in his neighborhood, a Muslim mechanic presses forward to repair a historic truck that will transport Gandhi’s last remains.'),
(81217437, 'Mandi', 'January 1, 2020', 1983, 'TV-MA', '155 min', 'Forbidden love, fraying loyalties and flagrant hypocrisy emerge when sanctimonious politicians drive a madam’s brothel from the heart of Hyderabad.'),
(81217438, 'Union Leader', 'December 31, 2019', 2017, 'TV-14', '105 min', 'Toxic conditions and a corrupt union leader prompt a chemical plant worker and earnest family man to fight for justice for his fellow laborers.'),
(81217737, 'Guna 369', 'November 15, 2019', 2019, 'TV-MA', '143 min', 'A pampered but kind-hearted average joe ditches his romancing and peacekeeping ways when he’s framed for a murder he didn’t commit.'),
(81217738, 'Dorasaani', 'November 20, 2019', 2019, 'TV-14', '134 min', 'A village landlord\'s daughter and an educated commoner must decide if their budding forbidden love is worth resisting a repressive social hierarchy.'),
(81217739, 'Mallesham', 'November 20, 2019', 2019, 'TV-PG', '131 min', 'A self-trained engineer risks debt, love and reputation in his quest to improve the grueling work conditions of his mother and her weaving community.'),
(81217741, 'Mahi NRI', 'December 1, 2019', 2017, 'TV-14', '134 min', 'A Punjabi man attempts to build a life in London in hopes of impressing his girlfriend’s mother, who insists her daughter marry a man outside of India.'),
(81217742, 'Thug Life', 'December 1, 2019', 2017, 'TV-14', '133 min', 'A get-rich-quick scheme goes awry when a group of friends stumbles onto a dangerous conspiracy and wind up getting mistaken for the bad guys.'),
(81217745, 'Baby Dolls', 'December 1, 2019', 2019, 'TV-14', '127 min', 'When two sisters travel from Canada to Punjab to visit their maternal family, they discover an opportunity to mend a broken bond with their grandmother.'),
(81217746, 'High End Yaariyan', 'December 1, 2019', 2019, 'TV-14', '120 min', 'From romantic pursuits to their friendship, a trio of young men navigate the complexities of relationships while sharing a London apartment.'),
(81217747, 'Qismat', 'December 1, 2019', 2018, 'TV-PG', '137 min', 'A young villager moves to Chandigarh and falls for his bubbly neighbor, but their love story is affected by several heartbreaking twists of fate.'),
(81217749, 'SunGanges', 'November 15, 2019', 2018, 'TV-PG', '74 min', 'A trio of filmmakers treks across India to explore the correlation between vanishing rivers, massive energy projects and renewable energy sources.'),
(81218074, 'Shelby American', 'November 22, 2019', 2019, 'TV-14', '119 min', 'Featuring interviews and vintage footage, this documentary traces American icon Carroll Shelby\'s life of reinvention from farmer to racer to entrepreneur.'),
(81218079, 'Awake', 'November 24, 2019', 2019, 'TV-MA', '92 min', 'After an accident leaves him with no recollection of who he is, a man becomes a prime suspect in the search for a serial killer targeting young women.'),
(81221851, 'Women of Mafia 2', 'January 14, 2020', 2019, 'TV-MA', '132 min', 'When a major drug deal goes sour, the queen of the Warsaw underworld must contend with a rival criminal, a crossed ally and a religious fighter.'),
(81221873, 'Zoom', 'January 11, 2020', 2006, 'PG', '88 min', 'Dragged from civilian life, a former superhero must train a new crop of youthful saviors when the military preps for an attack by a familiar villain.'),
(81221913, 'Kuldip Patwal: I Didn\'t Do It!', 'December 31, 2019', 2017, 'TV-MA', '126 min', 'Accused of killing a politician, a local grocer’s fight to prove his innocence reveals his lifelong struggles with injustice leading up to the incident.'),
(81221914, 'Saath Saath', 'December 31, 2019', 1982, 'TV-14', '118 min', 'A young woman falls for her classmate’s idealistic, non-materialistic ways, but is troubled upon seeing his principles change after they marry.'),
(81227195, 'Kalushi: The Story of Solomon Mahlangu', 'November 29, 2019', 2016, 'TV-MA', '107 min', 'The life and times of iconic South African liberation fighter Solomon Mahlangu, who battled the forces of apartheid, come into focus.'),
(81228864, 'Blitz Patrollie', 'December 27, 2019', 2013, 'TV-MA', '102 min', 'Caught between family pressures and small-time crime-fighting, a pair of bumbling cops tries to bust a massive drug deal and go down in history.'),
(81235729, 'Jezebel', 'January 16, 2020', 2019, 'TV-MA', '86 min', 'During the internet\'s infancy, a vulnerable woman follows her sister into the sex industry as a webcam model but her sudden popularity tests their bond.');
